import React from "react";
import logo from "./logo.svg";
// import "./App.css";

function App() {
  return (
    <div className="container">
      <div className="App">
        <header className="App-header">
          <h1 className="center-align">hello world</h1>
        </header>
      </div>
    </div>
  );
}

export default App;
